package com.apex.platform.stringmanipulation;

import java.util.HashMap;
import java.util.Map;
import java.util.Map.Entry;

public class SherlockMain
{

	public static void main(String[] args)
	{

		//String s = "abcdefghhgfedecba"; // output is "YES"
		//String s = "aabbccddeefghi";//Output is "NO"
		String s = "";
		//String s = "";
		//String s = "aaaabbcc";
		//String s = "aaaaabc";
		System.out.println(isValid(s));
	}

	static String isValid(String s)
	{
		Map<Character, Integer> sherlockMap = new HashMap<Character, Integer>();
		for (int i = 0; i < s.length(); i++)
		{
			char c = s.charAt(i);
			if (sherlockMap.containsKey(c))
			{
				sherlockMap.put(c, sherlockMap.get(c) + 1);
			}
			else
			{
				sherlockMap.put(c, 1);
			}
		}
		Map<Integer, StringBuilder> duplicatedMap = new HashMap<Integer, StringBuilder>();
		for (Entry<Character, Integer> entry : sherlockMap.entrySet())
		{
			duplicatedMap.put(entry.getValue(),
					duplicatedMap.get(entry.getValue()) == null ? new StringBuilder().append(entry.getKey())
							: duplicatedMap.get(entry.getValue()).append("~").append(entry.getKey()));

		}
		int oneInstance = 0;
		int TotalCharacter = 0;
		for (Entry<Integer, StringBuilder> enry : duplicatedMap.entrySet())
		{
			if (enry.getValue().indexOf("~") == -1 || duplicatedMap.size() == 1)
			{
				oneInstance++;
			}
			TotalCharacter = TotalCharacter + enry.getKey();
		}
		if (oneInstance == 1)
		{
			if (TotalCharacter == 6)
				return "NO";
			else
				return "YES";
		}
		else
		{
			return "NO";
		}

	}
}
